DROP TABLE IF EXISTS `shop_goods`;

CREATE TABLE `shop_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) NOT NULL COMMENT '商品名称',
  `remark` text COMMENT '商品摘要',
  `content` longtext COMMENT '商品详情',
  `parameter` text COMMENT '商品参数',
  `brand` varchar(50) DEFAULT NULL COMMENT '品牌',
  `artNo` varchar(50) DEFAULT NULL COMMENT '货号',
  `tagprice` decimal(11,2) DEFAULT NULL COMMENT '吊牌价',
  `year` varchar(50) DEFAULT NULL COMMENT '上市年份',
  `sex` varchar(50) DEFAULT NULL COMMENT '适用性别',
  `thumbnail` text COMMENT '商品缩略图',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `price` decimal(11,2) DEFAULT NULL COMMENT '价格',
  `oldPrice` decimal(11,2) DEFAULT NULL COMMENT '旧价格',
  `resalePrice` decimal(11,2) DEFAULT NULL COMMENT '转售价格',
  `userId` int(11) DEFAULT NULL COMMENT '创建人id',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0上架1下架 2删除',
  `sellCount2` int(11) NOT NULL DEFAULT '0' COMMENT '假销量',
  `sellCount` int(11) NOT NULL DEFAULT '0' COMMENT '销量',
  `stock` int(11) NOT NULL DEFAULT '100' COMMENT '库存',
  `recommend` int(1) NOT NULL DEFAULT '0' COMMENT '0不推荐 1推荐',
  `ishot` int(1) unsigned zerofill NOT NULL DEFAULT '0' COMMENT '0普通1热门',
  `labelId` int(11) NOT NULL COMMENT '分类id',
  `shopModId` int(11) DEFAULT NULL COMMENT '商品模型id',
  `serviceType` int(11) NOT NULL DEFAULT '-2' COMMENT '-2都没有，0包邮， 1七天内退货，2包邮+七天内退货',
  `updateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新日期',
  `roomId` int(11) DEFAULT NULL COMMENT '关联直播间id',
  `del` int(1) DEFAULT '0' COMMENT '0正常1删除',
  `resaleNum` int(11) DEFAULT '0' COMMENT '转售次数',
  `type` int(1) DEFAULT '0' COMMENT '商品类型 0商城 1直播',
  `video` text COMMENT '视频地址',
  `sellState` int(1) DEFAULT '1' COMMENT '0已出售1未出售',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 COMMENT='商品表';

