  `goodsId` int(11) NOT NULL,
  `marketId` int(11) NOT NULL,
  `fz` int(11) NOT NULL DEFAULT '0' COMMENT '0上架1下架',
  `createTime` datetime NOT NULL,
  PRIMARY KEY (`id`),
