DROP TABLE IF EXISTS `shop_order`;

CREATE TABLE `shop_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orderNo` varchar(100) NOT NULL COMMENT '订单号',
  `accountId` int(11) NOT NULL,
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `desc` varchar(500) DEFAULT NULL COMMENT '订单描述',
  `money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '付款金额:RMB',
  `integral` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '积分',
  `freight` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `expressNo` varchar(80) DEFAULT NULL COMMENT '物流单号',
  `coupon` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '优惠价格',
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0立即购买订单1购物车订单',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0未支付1正在支付中2已支付3支付失败4正在退款中5已退款6取消订单7已发货8确认收货待评价9已评价完成10售后关闭',
  `refundState` int(1) NOT NULL DEFAULT '0' COMMENT '0正常1此订单存在未处理售后2售后已处理',
  `refundReason` varchar(200) DEFAULT NULL COMMENT '退款理由（未发货时）',
  `payType` int(1) NOT NULL DEFAULT '0' COMMENT '0支付宝1微信2余额',
  `addressName` varchar(50) DEFAULT NULL COMMENT '收货人名称',
  `address` varchar(500) DEFAULT NULL COMMENT '收货地址',
  `addressPhone` varchar(50) DEFAULT NULL COMMENT '收货人电话',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `sendTime` datetime DEFAULT NULL COMMENT '发货时间',
  `refundTime` datetime DEFAULT NULL COMMENT '退款时间',
  `finishTime` datetime DEFAULT NULL COMMENT '收货时间',
  `transId` varchar(64) DEFAULT NULL COMMENT '支付订单号',
  `timeEnd` varchar(19) DEFAULT NULL COMMENT '支付成功时间',
  `isDel` int(11) NOT NULL DEFAULT '0' COMMENT '0正常1已经被删除',
  `goodsId` int(11) DEFAULT NULL COMMENT '商品id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderNo` (`orderNo`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=146 DEFAULT CHARSET=utf8 COMMENT='订单表';

