/*Table structure for table `shop_order_goods` */

DROP TABLE IF EXISTS `shop_order_goods`;

CREATE TABLE `shop_order_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orderId` int(11) NOT NULL,
  `orderNo` varchar(200) DEFAULT NULL,
  `goodsId` int(11) NOT NULL,
  `skuId` int(11) NOT NULL,
  `skuCode` varchar(200) DEFAULT NULL,
  `goodsName` varchar(200) NOT NULL,
  `skuImg` varchar(200) DEFAULT NULL,
  `price` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '商品单价',
  `num` int(11) NOT NULL DEFAULT '1' COMMENT '订单商品总数量',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0正常订单1退货退款中2仅退款中3已退款4售后关闭',
  `refundOrderId` int(1) DEFAULT NULL COMMENT '退货订单id',
  `refundNum` int(11) NOT NULL DEFAULT '0' COMMENT '退货商品数量',
  `createTime` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `orderId` (`orderId`) USING BTREE,
  KEY `goodsId` (`goodsId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 COMMENT='订单商品表';

