/*Table structure for table `shop_payments` */

DROP TABLE IF EXISTS `shop_payments`;

CREATE TABLE `shop_payments` (
  `id` int(11) NOT NULL,
  `accountId` int(11) NOT NULL,
  `name` varchar(100) NOT NULL COMMENT '名称',
  `desc` varchar(500) DEFAULT NULL COMMENT '订单描述',
  `money` double(11,2) NOT NULL DEFAULT '0.00' COMMENT '金额:RMB',
  `integral` double(11,2) NOT NULL DEFAULT '0.00' COMMENT '积分',
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0收入1支出',
  `createTime` datetime NOT NULL,
  `mType` int(1) NOT NULL DEFAULT '0' COMMENT '0充值1商品2私聊3视频4提现5打赏6礼物',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='收支表';

/*Data for the table `shop_payments` */

/*Table structure for table `shop_recharge` */

DROP TABLE IF EXISTS `shop_recharge`;

CREATE TABLE `shop_recharge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `accountId` int(11) NOT NULL,
  `count` double(11,2) NOT NULL COMMENT '充值金额',
  `donationAmount` double(11,2) DEFAULT NULL COMMENT '赠送金额',
  `donationIntegral` double(11,2) DEFAULT NULL COMMENT '赠送积分',
  `payType` int(1) NOT NULL COMMENT '0支付宝1微信',
  `state` int(1) NOT NULL COMMENT '0未支付1已支付',
  `createTime` datetime NOT NULL,
  `desc` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='充值订单表';

