/*Table structure for table `shop_refund_order` */

DROP TABLE IF EXISTS `shop_refund_order`;

CREATE TABLE `shop_refund_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `no` varchar(200) NOT NULL,
  `orderId` int(11) NOT NULL COMMENT '订单id',
  `userId` int(11) NOT NULL COMMENT '用户id',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0申请中1已通过等待退款2不通过申请3关闭申请4退货|退款完成5已通过等待上传物流单号退货6已上传物流单号7上传物流单号后不通过8上传物流单号后通过等待退款10超时自动退款',
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0仅退款（发货前）1退货退款 2仅退款（发货后未收到货）',
  `money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '退款金额:RMB',
  `reason` varchar(200) DEFAULT NULL COMMENT '退货理由',
  `refuseReason` varchar(200) DEFAULT NULL COMMENT '拒绝理由',
  `logisticsNo` varchar(200) DEFAULT NULL COMMENT '退货物流单号',
  `logisticsName` varchar(200) DEFAULT NULL COMMENT '物流公司',
  `img1` varchar(200) DEFAULT NULL COMMENT '图片1',
  `img2` varchar(200) DEFAULT NULL,
  `img3` varchar(200) DEFAULT NULL,
  `img4` varchar(200) DEFAULT NULL,
  `img5` varchar(200) DEFAULT NULL,
  `img6` varchar(200) DEFAULT NULL,
  `createTime` datetime NOT NULL COMMENT '提交时间',
  `auditTime` datetime DEFAULT NULL COMMENT '审核时间',
  `refundTime` datetime DEFAULT NULL COMMENT '退款时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `no` (`no`) USING BTREE,
  KEY `orderGoodsId` (`orderId`) USING BTREE,
  KEY `userId` (`userId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COMMENT='退款订单';

