  `invitationCode` varchar(127) DEFAULT NULL COMMENT '邀请码',
  `parentId` int(11) DEFAULT NULL COMMENT '上级的用户id(本表的id)',
  PRIMARY KEY (`id`),
  KEY `id` (`id`) USING BTREE
