/*Table structure for table `tb_balance_record` */

DROP TABLE IF EXISTS `tb_balance_record`;

CREATE TABLE `tb_balance_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL COMMENT '用户ID',
  `ids` int(11) NOT NULL DEFAULT '0' COMMENT '对象用户（谁发的，发给谁）',
  `sourceId` int(11) NOT NULL DEFAULT '0' COMMENT '来源id（红包id，充值id，提币id，糖果id等）',
  `type` int(1) NOT NULL COMMENT '0支出 1收入',
  `coinTypeId` int(11) DEFAULT NULL COMMENT '币种Id',
  `msgType` int(2) DEFAULT NULL COMMENT '1充值 2提币 3红包 4红包退款 5转账好友 6转账退款 ',
  `message` varchar(300) NOT NULL COMMENT '消息内容',
  `coinCode` varchar(50) DEFAULT NULL COMMENT '单位',
  `amount` decimal(20,8) NOT NULL COMMENT '金额',
  `balance` decimal(20,8) DEFAULT NULL COMMENT '当时剩下余额',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='账目明细';

