/*Table structure for table `tb_notice` */

DROP TABLE IF EXISTS `tb_notice`;

CREATE TABLE `tb_notice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL,
  `remark` varchar(500) DEFAULT NULL,
  `content` varchar(1000) DEFAULT NULL,
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0系统通知 1个人通知2系统后台消息',
  `ids` int(11) DEFAULT NULL,
  `createTime` datetime DEFAULT NULL COMMENT '创建日期',
  `msgType` int(1) DEFAULT '0' COMMENT '0文本 1订单  2超链接 3回复话题 3回复评论',
  `sendState` int(1) DEFAULT '0' COMMENT '发送类型:0全部',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='通知信息表';

/*Data for the table `tb_notice` */

/*Table structure for table `tb_notice_account` */

DROP TABLE IF EXISTS `tb_notice_account`;

CREATE TABLE `tb_notice_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `noticeId` int(11) NOT NULL,
  `accountId` int(11) NOT NULL DEFAULT '0',
  `readTime` datetime DEFAULT NULL COMMENT '阅读时间',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '0未读1已读',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='通知用户关联表';

/*Data for the table `tb_notice_account` */

/*Table structure for table `tb_options` */

DROP TABLE IF EXISTS `tb_options`;

CREATE TABLE `tb_options` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `key` varchar(100) DEFAULT NULL,
  `value` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统信息';

/*Data for the table `tb_options` */

/*Table structure for table `tb_problem` */

DROP TABLE IF EXISTS `tb_problem`;

CREATE TABLE `tb_problem` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '标题',
  `content` varchar(2000) NOT NULL COMMENT '内容',
  `createTime` datetime NOT NULL,
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='问题表';

