  `userId` int(11) DEFAULT NULL,
  `from` varchar(120) DEFAULT NULL COMMENT '来源 ',
  `count` decimal(11,2) NOT NULL DEFAULT '0.00',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '0未入账 1已进账2已记录',
