/*Table structure for table `webcast_associate_request` */

DROP TABLE IF EXISTS `webcast_associate_request`;

CREATE TABLE `webcast_associate_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `merchantAccountId` int(11) DEFAULT NULL COMMENT '商家Id',
  `anchorAccountId` int(11) DEFAULT NULL COMMENT '主播Id',
  `createTime` datetime DEFAULT NULL,
  `state` int(1) DEFAULT '0' COMMENT '0请求开播中1同意2拒绝',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='商家关联主播请求表';

/*Data for the table `webcast_associate_request` */

/*Table structure for table `webcast_broadcast_request` */

DROP TABLE IF EXISTS `webcast_broadcast_request`;

CREATE TABLE `webcast_broadcast_request` (
  `id` int(11) NOT NULL,
  `createTime` datetime DEFAULT NULL,
  `state` int(1) DEFAULT '0' COMMENT '0请求开播中1同意2拒绝',
  `accountId` int(11) DEFAULT NULL COMMENT '主播id(请求人Id)',
  `merchantAccountId` int(11) DEFAULT NULL COMMENT '商家用户Id',
  `isShow` int(1) DEFAULT '0' COMMENT '0未开播1已开播',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `webcast_broadcast_request` */

/*Table structure for table `webcast_report` */

DROP TABLE IF EXISTS `webcast_report`;

CREATE TABLE `webcast_report` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) DEFAULT '0' COMMENT '举报类型 0投诉主播1投诉客服2物流状况3y优惠活动4功能异常5表扬6建议7其他',
  `description` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `account` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '微信账号或手机号',
  `accountId` int(20) DEFAULT NULL,
  `targetId` int(20) DEFAULT NULL,
  `createTime` datetime DEFAULT NULL,
  `targetAccount` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `state` int(1) DEFAULT '0' COMMENT '0待处理1已处理',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='投诉表';

/*Data for the table `webcast_report` */

/*Table structure for table `webcast_room` */

DROP TABLE IF EXISTS `webcast_room`;

CREATE TABLE `webcast_room` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `image` varchar(255) DEFAULT NULL COMMENT '封面',
  `name` varchar(255) DEFAULT NULL COMMENT '直播间名称',
  `desc` varchar(255) DEFAULT NULL COMMENT '简介',
  `address` varchar(255) DEFAULT NULL COMMENT '直播间地址',
  `roomIntroduction` text COMMENT '直播间介绍',
  `anchorIntroduction` varchar(255) DEFAULT NULL COMMENT '主播介绍',
  `announcement` varchar(255) DEFAULT NULL COMMENT '公告',
  `accountId` int(11) DEFAULT NULL,
  `roomNumber` varchar(255) DEFAULT NULL COMMENT '直播间编号',
  `state` int(1) DEFAULT NULL COMMENT '0直播中1冻结2离线',
  `createTime` datetime DEFAULT NULL,
  `followNumber` int(11) DEFAULT '0' COMMENT '关注人数',
  `zanNumber` int(11) DEFAULT '0' COMMENT '点赞数量',
  `robotNumber` int(11) DEFAULT '0' COMMENT '机器人数量',
  `peakNumber` int(11) DEFAULT '0' COMMENT '最高峰人数',
  `roomRecordId` int(11) DEFAULT NULL COMMENT '当前正在的直播的记录Id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='直播间';

/*Data for the table `webcast_room` */

/*Table structure for table `webcast_room_account` */

DROP TABLE IF EXISTS `webcast_room_account`;

CREATE TABLE `webcast_room_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `accountId` int(11) DEFAULT NULL,
  `roomId` int(11) DEFAULT NULL,
  `ironValue` int(11) DEFAULT NULL,
  `createTime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='直播间关联用户';

/*Data for the table `webcast_room_account` */

/*Table structure for table `webcast_room_management` */

DROP TABLE IF EXISTS `webcast_room_management`;

CREATE TABLE `webcast_room_management` (
  `id` int(11) NOT NULL,
  `state` int(1) DEFAULT '0' COMMENT '0正常1删除',
  `manageAccountId` int(11) DEFAULT NULL COMMENT '关联的房管id',
  `merchantAccountId` int(11) DEFAULT NULL COMMENT '商家id',
  `createTime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='直播间关联房管表';

/*Data for the table `webcast_room_management` */

/*Table structure for table `webcast_room_merchant` */

DROP TABLE IF EXISTS `webcast_room_merchant`;

CREATE TABLE `webcast_room_merchant` (
  `id` int(11) NOT NULL,
  `state` int(1) DEFAULT '0' COMMENT '0正常1删除',
  `merchantAccountId` int(11) DEFAULT NULL COMMENT '关联的商家id',
  `roomId` int(11) DEFAULT NULL COMMENT '主播房间ID',
  `anchorAccountId` int(11) DEFAULT NULL COMMENT '主播Id',
  `createTime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='房间关联商家表';

/*Data for the table `webcast_room_merchant` */

/*Table structure for table `webcast_room_record` */

DROP TABLE IF EXISTS `webcast_room_record`;

CREATE TABLE `webcast_room_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `createTime` datetime DEFAULT NULL COMMENT '创建时间（即开播时间）',
  `roomId` int(11) DEFAULT NULL,
  `state` int(1) DEFAULT '0' COMMENT '0直播中1已关闭',
  `accountId` int(11) DEFAULT NULL,
  `endTime` datetime DEFAULT NULL COMMENT '开播结束时间',
  `peakNumber` int(11) DEFAULT '0' COMMENT '当前记录开播的最高人数',
  `playUrl` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '播放流',
  `pushUrl` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '推流',
  `watchNumber` int(11) DEFAULT '0' COMMENT '观看人数',
  `beginTime` datetime DEFAULT NULL COMMENT '开播时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='直播间记录';

